import React, { Component } from 'react';
import { TopNav, Menu, FlexContainer } from './components';
import Map from './map';

class App extends Component {
	constructor(props){
		this.mapRef = React.createRef();
	}

  render() {
    return (
      <div >
        <TopNav />
       <FlexContainer children={[Menu(this.mapRef), <Map ref={this.mapRef} />]} />
      </div>
    );
  }
}

export default App;
